import React from "react";
import { render } from "react-dom";

export class Navbar extends React.Component {
  render() {
    return (
      <nav>
        <ul className="nav-list">
          <li>women</li>
          <li>men</li>
          <li>kids</li>
        </ul>
      </nav>
    );
  }
}
